import React, { useState, useEffect } from 'react';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';
import { getAdminConfig } from '../api';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:8080';

const componentsMeta = [
  { key: 'ABOUT_ME', name: 'About Me', icon: 'üìù' },
  { key: 'ADDRESS', name: 'Address', icon: 'üè†' },
  { key: 'BIRTHDATE', name: 'Birthdate', icon: 'üéÇ' }
];

function AdminDashboard() {
  const [config, setConfig] = useState({});
  const [loading, setLoading] = useState(true);
  const [saving, setSaving] = useState(false);

  useEffect(() => {
    loadConfig();
  }, []);

  const loadConfig = async () => {
    try {
      const response = await getAdminConfig();
      setConfig(response || {});
    } catch (error) {
      console.error('Failed to load config:', error);
    } finally {
      setLoading(false);
    }
  };

  const onDragEnd = (result) => {
    const { source, destination, draggableId } = result;
    if (!destination) return;
    if (
      source.droppableId === destination.droppableId &&
      source.index === destination.index
    ) return;

    const startPage = parseInt(source.droppableId);
    const endPage = parseInt(destination.droppableId);

    const startList = Array.from(config[startPage] || []);
    const endList = Array.from(config[endPage] || []);

    // Remove from source
    startList.splice(source.index, 1);

    // Add to destination
    endList.splice(destination.index, 0, draggableId);

    const newConfig = {
      ...config,
      [startPage]: startList,
      [endPage]: endList
    };

    setConfig(newConfig);
  };

  const saveConfig = async () => {
    setSaving(true);
    try {
      const componentPageMap = {};
      Object.entries(config).forEach(([page, comps]) => {
        comps.forEach(comp => {
          componentPageMap[comp] = parseInt(page);
        });
      });

      const response = await fetch(`${API_URL}/api/admin/config`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ componentPageMap })
      });

      if (response.ok) {
        alert('‚úÖ Configuration saved successfully!');
      } else {
        alert('‚ùå Failed to save configuration');
      }
    } catch (error) {
      console.error('Save error:', error);
      alert('‚ùå Error saving configuration');
    } finally {
      setSaving(false);
    }
  };

  if (loading) return <div style={{ padding: 20 }}>Loading...</div>;

  return (
    <div style={{ padding: 20, maxWidth: 800, margin: '0 auto' }}>
      <h1>üîß Admin Dashboard</h1>
      <p>Drag and drop components between pages.</p>

      <DragDropContext onDragEnd={onDragEnd}>
        <div style={{ display: 'flex', gap: 30, marginTop: 30 }}>
          {[2, 3].map(page => (
            <Droppable droppableId={page.toString()} key={page}>
              {(provided) => (
                <div
                  ref={provided.innerRef}
                  {...provided.droppableProps}
                  style={{
                    flex: 1,
                    border: `2px solid ${page === 2 ? '#007bff' : '#28a745'}`,
                    borderRadius: 10,
                    padding: 20,
                    background: '#f8f9fa',
                    minHeight: 300
                  }}
                >
                  <h2>{page === 2 ? 'üìÑ Page 2' : 'üìÑ Page 3'}</h2>
                  {(config[page] || []).map((compKey, index) => {
                    const comp = componentsMeta.find(c => c.key === compKey);
                    return (
                      <Draggable draggableId={compKey} index={index} key={compKey}>
                        {(provided) => (
                          <div
                            ref={provided.innerRef}
                            {...provided.draggableProps}
                            {...provided.dragHandleProps}
                            style={{
                              ...provided.draggableProps.style,
                              background: 'white',
                              padding: 10,
                              margin: '5px 0',
                              borderRadius: 5,
                              border: '1px solid #ddd'
                            }}
                          >
                            {comp?.icon || '‚ùì'} {comp?.name || compKey}
                          </div>
                        )}
                      </Draggable>
                    );
                  })}
                  {provided.placeholder}
                </div>
              )}
            </Droppable>
          ))}
        </div>
      </DragDropContext>

      <div style={{ marginTop: 30, textAlign: 'center' }}>
        <button
          onClick={saveConfig}
          disabled={saving}
          style={{
            padding: '15px 30px',
            backgroundColor: saving ? '#999' : '#dc3545',
            color: 'white',
            border: 'none',
            borderRadius: 5,
            fontSize: 16,
            cursor: saving ? 'not-allowed' : 'pointer'
          }}
        >
          {saving ? 'Saving...' : 'üíæ Save Configuration'}
        </button>
      </div>
    </div>
  );
}

export default AdminDashboard;
